import React from "react";

class Gifticon extends React.Component{
    render(){
        return(
            <div>
                <h2>{this.props.name}</h2>
                <p>{this.props.exp_date}</p>
                <p>{this.props.used}</p>
            </div>
        )
    }
}

class GifticonImg extends React.Component{
    render(){
        return(
            <div>
                <h2>{this.props.id}</h2>
                <h2>{this.props.name}</h2>
                <img src={this.props.img} alt="image"/>
            </div>
        )
    }
}

class GifticonInfo extends React.Component{
    render(){
        return(
            <div>
                <p>{this.props.exp_date}</p>
                <p>{this.props.used}</p>
            </div>
        )
    }
}

export default Gifticon;
